<!DOCTYPE html>
<head>
<title></title>
<meta http-equiv="Content-Type" content="text/html; charset=UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0, minimum-scale=1, maximum-scale=1, user-scalable=no" /><script>$MENU = false; 
$BACK_COLOR = "#3A3A3A"; 
var $ = function(e) { return document.getElementById(e) };
var $CURRENT, $SAVEDATAS = null;
var $WIDTH = 0,
$HEIGHT = 0; 
var $MESSAGE = "";
var resize = function() {
var frame = $("frame");
frame.width = 0;
frame.height = 0;
var mh = ($MENU) ? 60 : 0;
var ww = window.parent.innerWidth;
var wh = window.parent.innerHeight;
scale = Math.min(ww / $WIDTH, (wh - mh) / $HEIGHT);
frame.style.left = (ww - $WIDTH * scale) / 2 + "px";
$("navigation").style["width"] = ww + "px";
frame.width = $WIDTH;
frame.height = $HEIGHT;
frame.style["transform-origin"] = "0 0";
frame.style["transform"] = "scale(" + scale + ")";
var modal_download_dialog = $("modal_download_content");
modal_download_dialog.style["left"] = (($WIDTH * scale - 40) / 4) + "px";
modal_download_dialog.style["top"] = "10px";
modal_download_dialog.style["width"] = (($WIDTH * scale - 40) / 2) + "px";
setTimeout(function() { askToFrame("repaint") }, 500);
}
var showDownload = function(_link, _filename) {
var link = $("download_link");
link.href = _link;
link.download = _filename;
link.innerHTML = "Haga clic aquí para descargar el archivo " + _filename;
var modal = $("modal_download");
modal.style.display = "block";
link.onclick = link.ontouchstart = function() {
setTimeout(function() { modal.style.display = "none" }, 500);
}
}
var askToFrame = function(_m) {
$MESSAGE = _m;
var frame = $("frame");
frame.contentWindow.postMessage(_m, "*");
}
var receiveMessage = function(e) {
var datas = e.data;
if (datas === "figure_loaded") {
askToFrame("get_Original_Dims");
} else {
switch ($MESSAGE) {
case "get_SVG":
showDownload("data:image/svg+xml," + encodeURIComponent(datas), $URL[$CURRENT][1].split(".")[0] + ".svg")
break;
case "get_PNG":
showDownload(datas, $URL[$CURRENT][1].split(".")[0] + ".png");
break;
case "get_Source":
showDownload("data:application/octet-stream," + encodeURIComponent(datas), $URL[$CURRENT][1])
break;
                case "get_Original_Dims":
      $WIDTH = parseInt(datas[0]);
      $HEIGHT = parseInt(datas[1]);
      resize();
      break;
      }
      }
   }
   var getCSSRule = function(ruleName) {
   ruleName = ruleName.toLowerCase();
   var result = null;
   var find = Array.prototype.find;
   find.call(document.styleSheets, styleSheet => {
   result = find.call(styleSheet.cssRules, cssRule => {
   return cssRule instanceof CSSStyleRule &&
   cssRule.selectorText.toLowerCase() == ruleName;
   });
   return result != null;
   });
   return result;
  }
 var shadeBlend = function(p, c0, c1) {
 var n = p < 0 ? p * -1 : p,
 u = Math.round,
 w = parseInt;
 if (c0.length > 7) {
     var f = c0.split(","),
     t = (c1 ? c1 : p < 0 ? "rgb(0,0,0)" : "rgb(255,255,255)").split(","),
     R = w(f[0].slice(4)),
     G = w(f[1]),
     B = w(f[2]);
     return "rgb(" + (u((w(t[0].slice(4)) - R) * n) + R) + "," + (u((w(t[1]) - G) * n) + G) + "," + (u((w(t[2]) - B) * n) + B) + ")"
     } else {
     var f = w(c0.slice(1), 16),
     t = w((c1 ? c1 : p < 0 ? "#000000" : "#FFFFFF").slice(1), 16),
     R1 = f >> 16,
     G1 = f >> 8 & 0x00FF,
     B1 = f & 0x0000FF;
     return "#" + (0x1000000 + (u(((t >> 16) - R1) * n) + R1) * 0x10000 + (u(((t >> 8 & 0x00FF) - G1) * n) + G1) * 0x100 + (u(((t & 0x0000FF) - B1) * n) + B1)).toString(16).slice(1)
     }
    }
   var init = function() {
   var menus = $("navigation");
   getCSSRule("body").style["background-color"] = $BACK_COLOR;
   if ($MENU) {
       getCSSRule(".dropbtn").style["background-color"] = $BACK_COLOR;
       getCSSRule(".dropdown:hover .dropbtn").style["background-color"] = shadeBlend(-0.2, $BACK_COLOR);
       getCSSRule(".dropdown-content").style["background-color"] = $BACK_COLOR;
       getCSSRule(".dropdown-content a:hover").style["background-color"] = shadeBlend(-0.2, $BACK_COLOR);
   if ($URL.length === 1) {
       var file_menu = $("file_menu");
       file_menu.style["background-color"] = $BACK_COLOR;
       file_menu.style.display = "none";
      } else {
      var items = $("file_items");
      var inner = "";
      for (var i = 0; i < $URL.length; i++) {
          inner += "<a style='cursor:pointer'	onclick='new_frame_src('+ i + ')>"
          inner += $URL[i][0];
          inner += "</a>"
          }
         items.innerHTML = inner;
         }
       } else {
       menus.style.display = "none";
      }
      var modal_close = $("modal_close");
      modal_close.onclick = modal_close.ontouchstart = function() {
      var modal = $("modal_download");
      modal.style.display = "none";
      }
     window.onclick = window.ontouchstart = function(event) {
     var modal = $("modal_download");
     if (event.target == modal) {
     modal.style.display = "none";
     }
    }
    window.onblur = function() {
    var modal = $("modal_download");
    modal.style.display = "none";
    }
    window.onresize = resize;
   window.addEventListener("orientationchange", resize);
   window.addEventListener("message", receiveMessage);
   new_frame_src(0);
   }
</script>

@import url(https://fonts.googleapis.com/css?family=Open+Sans);
@import url(https://fonts.googleapis.com/css?family=Bree+Serif);
body {
font-family: "Open Sans", sans-serif;
width: 100%;
height: 100%;
margin: 0;
padding: 0;
overflow: hidden;
background-color: rgba(0, 0, 0, 0)
}
.navbtns_wrapper {
position: relative;
float: right;
/*background-color: red;*/
text-align: right;
color: white;
}
.navbtns_wrapper a {
cursor: pointer;
padding: 16px;
font-size: 16px;
text-decoration: none;
display: inline-block;
}
.dropbtn {
font-family: "Open Sans", sans-serif;
background-color: #4CAF50;
color: white;
padding: 16px;
font-size: 16px;
border: none;
cursor: pointer;
}
.dropdown {
position: relative;
display: inline-block;
}
.dropdown-content {
display: none;
position: absolute;
background-color: #f9f9f9;
min-width: 160px;
box-shadow: 0px 8px 16px 0px rgba(0, 0, 0, 0.2);
z-index: 4;
}
.dropdown-content a {
color: white;
padding: 12px 16px;
text-decoration: none;
display: block;
}
.dropdown-content a:hover {
background-color: #f1f1f1
}
.dropdown:hover .dropdown-content {
display: block;
}
.dropdown:hover .dropbtn {
background-color: #3e8e41;
}
.modal {
display: none;
position: fixed;
z-index: 5;
left: 0;
top: 0;
margin: 0;
width: 100%;
height: 100%;
overflow: auto;
background-color: rgb(0, 0, 0);
background-color: rgba(0, 0, 0, 0.4);
color: #333333;
}
.modal-content {
	position: absolute;
	background-color: #fefefe;
	left: 0px;
	padding: 20px;
	border: 1px solid #888;
	width: 50px;
	text-align: center;
}
.close {
	color: #aaaaaa;
	float: right;
	font-size: 28px;
	font-weight: bold;
}
.close:hover,
.close:focus {
	color: #000;
	text-decoration: none;
	cursor: pointer;
}
</style>
